Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.api.java.function.VoidFunction;
import scala.Tuple2;

import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Initialize Spark session
        // ...

        // Load onsite attributed data
        JavaRDD<String> onsiteData = spark.read().textFile("onsite_data.txt").javaRDD();

        // Load top frequent queries
        JavaRDD<String> topQueries = spark.read().textFile("top_queries.txt").javaRDD();

        // Convert top queries to a map for efficient lookup
        final Map<String, Long> topQueriesMap = topQueries.collectAsMap();

        // Create a cache to store queries and their last access time
        final Map<String, Long> queryCache = new HashMap<>();

        // Calculate hit rate
        long cacheMisses = onsiteData.map(new Function<String, Tuple2<String, Long>>() {
            @Override
            public Tuple2<String, Long> call(String line) throws Exception {
                String[] parts = line.split(",");
                String query = parts[0];
                long timestamp = Long.parseLong(parts[1]);

                if (topQueriesMap.containsKey(query)) {
                    Long lastAccessTime = queryCache.get(query);
                    if (lastAccessTime == null || timestamp - lastAccessTime > 12 * 60 * 60 * 1000) {
                        // Cache miss, update cache and return 1
                        queryCache.put(query, timestamp);
                        return new Tuple2<>(query, 1L);
                    } else {
                        // Cache hit, return 0
                        return new Tuple2<>(query, 0L);
                    }
                }

                // Query not in top queries, return 0
                return new Tuple2<>(query, 0L);
            }
        }).reduce(new Function2<Tuple2<String, Long>, Tuple2<String, Long>, Tuple2<String, Long>>() {
            @Override
            public Tuple2<String, Long> call(Tuple2<String, Long> v1, Tuple2<String, Long> v2) throws Exception {
                return new Tuple2<>(null, v1._2() + v2._2());
            }
        })._2();

        // Calculate total queries
        long totalQueries = onsiteData.count();

        // Calculate hit rate
        double hitRate = (totalQueries - cacheMisses) / (double) totalQueries;

        // Print hit rate
        System.out.println("Hit rate: " + hitRate);
    }
}
```

This job reads the onsite attributed data and top frequent queries, converts the top queries to a map for efficient lookup, and calculates the hit rate by iterating over the onsite data and checking if each query is in the top queries and if it's a cache hit or miss. The hit rate is then calculated as the number of cache hits divided by the total number of queries.

